$$.logout=function(){$$.confirm("Logout","Are you sure you want to logout?",function(){window.location="/logout"})},$$.selectRound=function(o){o=$(o),$$.confirm("Change round",'Are you sure you want to change round "<b>'+o.html()+'</b>"?',function(){var n=$("#menuRound"),t=o.attr("data-value");$.ajax({type:"put",url:"/state/round",data:{key:"round",value:t},dataType:"JSON",success:function(u){u.error?console.log(u.error):n.attr("data-value",t).html(o.html())},error:function(){console.log("Admin: Error when get round setting!")}})})},$$.updateRound=function(){$.ajax({type:"get",url:"/state/round",data:{key:"round"},dataType:"JSON",success:function(o){var n=$("#menuRound"),t=n.next().children().eq(o.round);n.attr("data-value",o.round).html(t.html())},error:function(){console.log("Admin: Error when get round setting!")}})};